"""**Tenure**"""

def tenure_group(tenure):
  if tenure <= 12 :
    return 'Dưới 1 năm'
  if tenure <= 24 :
    return 'Từ 1-2 năm'
  if tenure <= 36 :
    return 'Từ 2-3 năm'
  if tenure <= 48 :
    return 'Từ 3-4 năm'
  if tenure <= 60 :
    return 'Từ 4-5 năm'
  else:
    return 'Trên 5 năm'

df['tenure_group'] = df['tenure'].apply(tenure_group)
df['tenure_group']

